		_openPdf: function (base64) {

			var byteCharacters = window.atob(base64);
			var byteNumbers = new Array(byteCharacters.length);
			for (var i = 0; i < byteCharacters.length; i++) {
				byteNumbers[i] = byteCharacters.charCodeAt(i);
			}
			var byteArray = new Uint8Array(byteNumbers);
			var blob = new Blob([byteArray], { type: 'application/pdf' });

			var blobUrl = URL.createObjectURL(blob);
			jQuery.sap.addUrlWhitelist('blob');

			this._pdfViewer.setSource(blobUrl);
			this._pdfViewer.setVisible(true);
			this._pdfViewer.open();
		},
		onLiveChange: function (oEvent) {


			// Get the search query
			var sQuery = oEvent.getParameter("newValue").toLowerCase();

			// Build the filter array
			var aFilters = [];
			var sPaths = ["status", "currentDate", "SenderName", "TradeNumber", "DocumentNumber"];

			// Iterate through columns and create filters
			sPaths.forEach(function (sPath) {
				var oFilter = new Filter(sPath, FilterOperator.Contains, sQuery);
				aFilters.push(oFilter);
			});

			// Apply the filters
			var oBinding = this.byId("idProductsTable").getBinding("items");
			oBinding.filter(new Filter({
				filters: aFilters,
				and: false // OR operator for multiple filters
			}));
		},
